script: |
  super -f text -I q5307.spq | sort > q5307.out

inputs:
  - name: q5307.spq
    data: |
      SELECT DISTINCT - cor1.col0 * cor0.col1 AS col0 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
